import styles from './style.module.scss';
import { SortableContainer, SortableElement } from 'react-sortable-hoc';

const SortableList = SortableContainer(({ list }) => {
    return (
        <ul className={styles.list}>
            {
                list.map((item, index) => {
                    const { content, link, picUrl, title } = item?.attribute;
                    console.log(item);
                    return (
                        <li key={index}>
                            <a href={link}>
                                <img alt='img' src={picUrl} alt='请放入图片的正确链接'></img>
                                <h2 className={styles.title}>{title || '暂无内容'}</h2>
                                <p className={styles.desc}>
                                    {content || '暂无内容'}
                                </p>
                            </a>
                        </li>
                    )
                }

                )
            }
        </ul>
    );
});


const Article = (props) => {
    const { schema } = props;
    const { children } = schema;
    const { attributes } = schema;

    const onSortEnd = () => {

    }

    return (
        <div className={`wrapper ${styles.ArticleWrapper}`}>
            <div className={styles.AreaName}>{attributes?.title}</div>
            <SortableList list={children} onSortEnd={onSortEnd} distance={5} />
        </div>

    )
}

export default Article;
